/*Table structure for table `homereq` */

DROP TABLE IF EXISTS `homereq`;

CREATE TABLE `homereq` (
  `id` varchar(100) DEFAULT NULL,
  `hname` varchar(100) DEFAULT NULL,
  `cost` varchar(100) DEFAULT NULL,
  `uname` varchar(100) DEFAULT NULL,
  `status` varchar(100) DEFAULT 'request'
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `homereq` */

insert  into `homereq`(`id`,`hname`,`cost`,`uname`,`status`) values ('1','a','a','kumar','Accepted'),('2','duplex','20000','sarath','Accepted'),('3','flats','250000','kumar','Accepted'),('4','flats','200000','kumar','Accepted'),('5','houses','500000','kumar','request'),('5','houses','500000','kumar','request');

/*Table structure for table `loan` */

DROP TABLE IF EXISTS `loan`;

CREATE TABLE `loan` (
  `hname` varchar(100) DEFAULT NULL,
  `lamount` varchar(100) DEFAULT NULL,
  `dtime` varchar(100) DEFAULT NULL,
  `hadd` varchar(100) DEFAULT NULL,
  `id` int(100) NOT NULL AUTO_INCREMENT,
  `bank` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=latin1;

/*Data for the table `loan` */

insert  into `loan`(`hname`,`lamount`,`dtime`,`hadd`,`id`,`bank`) values ('duplex','100000','10 years','kukatpalli',1,NULL),('duplex','100000','10 years','kukatpalli',2,NULL),('sarath','500000','10 yrs','bangloore',3,'sbi'),('duplex','100000','10 years','kukatpalli',4,NULL),('houses','100000','20 years','bhanjara hills',5,NULL),('flats','200000','20yrs','blre',6,'hdfc');

/*Table structure for table `reg` */

DROP TABLE IF EXISTS `reg`;

CREATE TABLE `reg` (
  `uname` varchar(100) DEFAULT NULL,
  `mobile` varchar(10) DEFAULT NULL,
