/*Table structure for table `vaasthu` */

DROP TABLE IF EXISTS `vaasthu`;

CREATE TABLE `vaasthu` (
  `id` int(100) NOT NULL AUTO_INCREMENT,
  `uname` varchar(100) DEFAULT NULL,
  `query` mediumtext,
  `response` longtext,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1;

